import React from 'react';

const TodoClean = ({remove}) => {

    const handleClick = (e) => {
        localStorage.removeItem("my-todo-list");
    };


    return (
        <button onClick={handleClick} className="btn-clean">Clean</button>
    );
};

export default TodoClean;
